import React from 'react';
import styles from './styles.module.scss';
import tracks from '../../components/Track';

const Race = () => {
  return (
    <div>
      {tracks.map((track) => (
        <div key={track.name}>
          <h2>{track.title}</h2>
          <p>{track.description}</p>
          <span>Rewards: </span>
          <div>{track.button}</div>
        </div>
      ))}
    </div>
  );
};

export default Race;
